var momentDateFormat = "MMM DD, h:mm:ss a"

Handlebars.registerHelper("makeURL", function(run_id, target_name, state_vector) {
  return "/app/db/item?path=" + run_id + "." + target_name + "." + state_vector;
});

Handlebars.registerHelper("algorithmId", function(element_id) {
  return element_id.replace(".", "_");
});

Handlebars.registerHelper("taskStatus", function(task) {
  if (task.status == "active") {
    return "Active";
  } else {
    return moment(task.date).format(momentDateFormat);
  }
});

Handlebars.registerHelper("dateFormat", function(date) {
  if (date != "") {
    return moment(date).format(momentDateFormat);
  }
});

Handlebars.registerHelper("taskStatusClass", function(status) {
  if (status == "active") {
    return "bg-info";
  } else if (status == "complete") {
    return "bg-success";
  } else if (status == "queued") {
    return "bg-warning";
  } else {
    return "";
  }
});

Handlebars.registerHelper("algorithmStatusClass", function(status) {
  if (status == "active") {
    return "bg-info clickable";
  } else if (status == "complete") {
    return "bg-success clickable";
  } else if (status == "queued") {
    return "bg-warning clickable";
  } else {
    return "";
  }
});

Handlebars.registerHelper("activeTimeEnd", function(modal_data) {
  return timeSince(modal_data.start_date, Date());
});

Handlebars.registerHelper("scheduledTargets", function(targets) {
  return targets.join(", ");
});
