var logData = []

function getLogs(limit, showHide) {
  var limit = limit || 0;
  var showHide = showHide || "hide";
  $.ajax({
    url: "/app/pl/log",
    type: "GET"
  }).success(function(result) {
    var newData = $.parseJSON(result);
    var changedData = newData.filter(function(objFromA) {
      return !logData.find(function(objFromB) {
        return JSON.stringify(objFromA) == JSON.stringify(objFromB)
      })
    })
    if (limit != 0) {
      changedData = changedData.slice(0, limit);
    }
    $(HandlebarsTemplates['logs'](changedData)).hide().appendTo('.logs').slideDown("fast");
    if (showHide == "hide") {
      showHideLogEntries();
    }
    logData = newData;
  })
}

$(".log_controls").on("click", "a", function(e) {
  showHideLogEntries(e);
})

function showHideLogEntries(ev) {
  ev = ev || null
  if (ev) {
    var button = $(ev.target);
    if (button.parent("li").hasClass("active")) {
      button.parent("li").removeClass("active");
    } else {
      button.parent("li").addClass("active");
    }
  }
  var show = $(".log_controls .active a").map(function() {return $(this).data("level")})
  $('.logs .log').hide();
  $.each(show, function( index, value ) {
    $(".logs ." + value).show();
  });
}
