$(document).ready(function() {
  $('.search_box .form-control').keypress(function (e) {
    if (e.keyCode == 13) {
      submitSearch(e);
      $(".tt-menu").hide();
      return true;
    }
  });

  $('.search_box .btn').on("click", function(e) {
    var searchObject = {
      "currentTarget": {
        "value": $(e.currentTarget).parents(".search_box").find(".form-control").last().prop("value"),
        "id": $(e.currentTarget).parents(".search_box").find(".form-control").last().prop("id")
      }
    }
    submitSearch(searchObject);
  })

  $('.search_box .form-control').bind('typeahead:select', function(ev, suggestion) {
    submitSearch(ev);
  });

  $('.search').on("click", "label.btn", function(e) {
    $('.search label.btn').removeClass("active");
    $(this).addClass('active');
    return false;
  })
});

function submitSearch(event) {
  var query = event.currentTarget.value;
  var search_id = event.currentTarget.id;
  $(".search_box .form-control").prop("value", "");
  $("#" + search_id).prop("value", query);
  $("#results").html (HandlebarsTemplates['working']());
  $.ajax({
    url: "/app/search/" + search_id + "?key=" + query,
    type: "GET",
    success: function(result) {
      data = $.parseJSON(result);
      sortRunIds(data);
      $("#results").html(HandlebarsTemplates['prime_table_' + search_id](data));
      searchPrimeTableTnStyle(search_id);
    }
  });
}

function searchPrimeTableTnStyle(search_id) {
  var filters = {};
  var context = $(".search .search_box .active input").val();
  $.when(
    $.get("/app/filter/user", function(result) {
      filters["user"] = $.parseJSON(result);
    }),
    $.get("/app/filter/dev", function(result) {
      filters["dev"] = $.parseJSON(result);
    }),
    $.get("/app/filter/admin", function(result) {
      filters["admin"] = $.parseJSON(result);
    })
  ).then(function() {
    if (search_id == "tn") {
      if (context == "user") {
        // highlightPrimeTableTn(filters["user"], "#efefda");
        // highlightPrimeTableTn(filters["dev"], "#cae5d1");
        // highlightPrimeTableTn(filters["admin"], "#ddcae5");
        hidePrimeTableTn(filters["user"])
        hidePrimeTableTn(filters["dev"]);
        hidePrimeTableTn(filters["admin"]);
      }
      if (context == "dev") {
        highlightPrimeTableTn(filters["user"], "#efefda");
        // highlightPrimeTableTn(filters["dev"], "#cae5d1");
        // highlightPrimeTableTn(filters["admin"], "#ddcae5");
        // hidePrimeTableTn(filters["user"])
        hidePrimeTableTn(filters["dev"]);
        hidePrimeTableTn(filters["admin"]);
      }
      if (context == "admin") {
        highlightPrimeTableTn(filters["user"], "#efefda");
        highlightPrimeTableTn(filters["dev"], "#cae5d1");
        highlightPrimeTableTn(filters["admin"], "#ddcae5");
        // hidePrimeTableTn(filters["user"])
        // hidePrimeTableTn(filters["dev"]);
        // hidePrimeTableTn(filters["admin"]);
      }
    }
  });
}

function highlightPrimeTableTn(filters, color) {
  $.each(filters["include_only"], function( sv, run_ids ) {
    var row = "tr[data-sv='" + sv + "']";
    var runIdClasses = run_ids.map(x => "." + x).join(", ");
    $(row + " a:not(" + runIdClasses + ")").css({background: color, color: "#000"});
  });
  $.each(filters["exclude"], function( index, sv ) {
    if (sv.includes("^")) {
      var sv = sv.replace(/\^/g, "")
      var row = "tr[data-sv^='" + sv + "']";
      $(row).css({background: color});
    } else if (sv.includes("$")) {
      var sv = sv.replace(/\$/g, "")
      var row = "tr[data-sv$='" + sv + "']";
      $(row).css({background: color});
    } else {
      var row = "tr[data-sv='" + sv + "']";
      $(row).css({background: color});
    }
  });
}

function hidePrimeTableTn(filters) {
  $.each(filters["include_only"], function( sv, run_ids ) {
    var row = "tr[data-sv='" + sv + "']";
    var runIdClasses = run_ids.map(x => "." + x).join(", ");
    $(row + " a:not(" + runIdClasses + ")").hide();
  });
  $.each(filters["exclude"], function( index, sv ) {
    if (sv.includes("^")) {
      var sv = sv.replace(/\^/g, "")
      var row = "tr[data-sv^='" + sv + "']";
      $(row).hide();
    } else if (sv.includes("$")) {
      var sv = sv.replace(/\$/g, "")
      var row = "tr[data-sv$='" + sv + "']";
      $(row).hide();
    } else {
      var row = "tr[data-sv='" + sv + "']";
      $(row).hide();
    }
  });
}
