function sortStringsAsIntegers(a,b) {
  a = parseInt(a);
  b = parseInt(b);
  if (a > b) {
    return -1;
  }
  if (a < b) {
    return 1;
  }
  return 0;
}

function sortRunIds(data) {
  for (var dataIndex in data.items) {
    for (var targetIndex in data.items[dataIndex].targets) {
      data.items[dataIndex].targets[targetIndex].ids.sort(sortStringsAsIntegers);
    }
  }
}

$(".changeset_form").submit(function(form) {
  $(this).find('input[type=submit]').prop('disabled', true);
  $(this).find('input[type=submit]').val("Submitting, please wait...");
  $.ajax({
    url: "/app/submit",
    type: "POST",
    data: collectFormData(".changeset_form")
  }).done(function(result) {
    response = $.parseJSON(result);
    if (response.alert_status != "danger") {
      localStorage["alert_status"] = response.alert_status;
      localStorage["alert_message"] = response.alert_message;
      window.location.href = "/pages";
    } else {
      $("#alert-message").html(HandlebarsTemplates['alert'](response));
    }
    $(".changeset_form").find('input[type=submit]').prop('disabled', false);
    $(".changeset_form").find('input[type=submit]').val("Submit");
  })
  .fail(function() {
    $("#alert-message").html(HandlebarsTemplates['ajax_fail']());
  });
  form.preventDefault();
})

